import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { LogoComponent } from './component/logo/logo.component';
import { EncabezadoComponent } from './component/encabezado/encabezado.component';
import { RedsComponent } from './component/reds/reds.component';
import { BannerComponent } from './component/banner/banner.component';
import { SobreMiComponent } from './component/sobre-mi/sobre-mi.component';
import { ExperienciaComponent } from './component/experiencia/experiencia.component';
import { EduComponent } from './component/edu/edu.component';
import { NgCircleProgressModule } from 'ng-circle-progress';
import { ProgComponent } from './component/prog/prog.component';
import { ProyectosComponent } from './component/proyectos/proyectos.component';
import { FooterComponent } from './component/footer/footer.component';
import {HttpClient, HttpClientModule} from '@angular/common/http';
import { HomeComponent } from './component/home/home.component';
import { LoginComponent } from './component/login/login.component';

@NgModule({
  declarations: [
    AppComponent,
    LogoComponent,
    EncabezadoComponent,
    RedsComponent,
    BannerComponent,
    SobreMiComponent,
    ExperienciaComponent,
    EduComponent,
    ProgComponent,
    ProyectosComponent,
    FooterComponent,
    HomeComponent,
    LoginComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    NgCircleProgressModule.forRoot({
    }),
    HttpClientModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
